const port = 33771
const prefix = `http://localhost:${port}/`

export const fetch_data = async (method,params) => {
    const url = `${prefix}${method}`
    console.log(url,JSON.parse(params))
    const response = await fetch(url, {
        crossDomain: true,
        dataType: 'jsonp',
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
        },
        body: JSON.parse(params)
    })
    const data = await response.json()
    return data
}
